import{_ as e,c as r,a5 as n,G as p,B as t,o as c}from"./chunks/framework.O9ad3XaM.js";const m="/assets/1.oZJbvM9r.png",i="/assets/2.xxomGFu2.png",l="/assets/3.CZHgln8z.png",g="/assets/4.CR2CqX51.png",A="data:image/png;base64,",d="/assets/6.CygJtgLT.png",u="/assets/7.B4NJnWdj.png",h="/assets/8.Cb2E0jvb.png",E=JSON.parse('{"title":"资源包","description":"","frontmatter":{"sidebar_position":3,"title":"资源包","slug":"/resourcepack"},"headers":[],"relativePath":"Java/process/maintenance/resourcepack/resourcepack.md","filePath":"nitwikit/docs-java/process/maintenance/resourcepack/resourcepack.md","lastUpdated":1737805704000}'),k={name:"Java/process/maintenance/resourcepack/resourcepack.md"};function b(C,s,N,J,Z,y){const a=t("DocCardList"),o=t("nw-image-viewer");return c(),r("div",null,[s[0]||(s[0]=n('<h1 id="资源包" tabindex="-1">资源包 <a class="header-anchor" href="#资源包" aria-label="Permalink to &quot;资源包&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">提示</p><p>这一部分的教程不是教你如何<strong>制作</strong>资源包,而是教你如何<strong>托管/压缩/混淆</strong>资源包!!</p></div><p>现在，资源包(或者说材质包)能做的事越来越多，在高版本已经有了一个新的服务器类别。</p><p>很多人用 <strong>IA 服</strong> 来代指这一类服务器。</p><p>:::note</p><p>因为 ItemsAdder(ia)太有名于是所有类似服务器都被称为 ia 服了</p><p>:::</p><p>在这类服务器中，你可以用原版客户端只安装服务器发来的资源包而看到：</p><details><summary>点击展开</summary><p>全新的武器装备：</p><p><img src="'+m+'" alt=""></p><p>独特的装扮：</p><p><img src="'+i+'" alt=""></p><p>新的 GUI 界面：</p><p><img src="'+l+'" alt=""></p><p>称号或表情包：</p><p><img src="'+g+'" alt=""></p><p><img src="'+A+'" alt=""></p><p>家具或装饰：</p><p><img src="'+d+'" alt=""></p><p>新的生物或 boss：</p><p><img src="'+u+'" alt=""></p><p><img src="'+h+'" alt=""></p><p>以及更多你想不到的内容...</p></details><p>社区都发展成这样了，某些人还以为资源包 “必须修改原版物品” “生存一得到原版东西就露馅”</p><p>还有不少半吊子都不如的人以为做到折叠中的效果必须要 ia 或某某特定插件。</p><p>这都是原版资源包能做到的东西，ia 只是一个打包器，你有能力甚至可以自己手搓材质包。</p><h2 id="注意" tabindex="-1">注意 <a class="header-anchor" href="#注意" aria-label="Permalink to &quot;注意&quot;">​</a></h2><p>JAVA 版的资源包分发与基岩版不同，它是云分发的，提供给客户端的应该是一个<strong>直链</strong>，而不是资源包本身</p><p>不管你用什么方式，都必须是直链才可正常使用！</p><p><strong>什么是直链？</strong></p><blockquote><p>直接从服务器下载数据</p></blockquote><p>不需要登陆账号，不需要点击链接打开网页才下载</p>',18)),p(a),p(o)])}const B=e(k,[["render",b]]);export{E as __pageData,B as default};
